Office.onReady((info) => {
  if (info.host === Office.HostType.Word) {
    document.getElementById("sideload-msg").style.display = "none";
    document.getElementById("app-body").style.display = "flex";
    document.getElementById("hello-world").onclick = insertHelloWorld;
    document.getElementById("change-font").onclick = cycleFont;
    document.getElementById("change-size").onclick = cycleSize;
    document.getElementById("change-color").onclick = cycleColor;
    document.getElementById("add-image").onclick = addImage;
  }
});

// Arrays of fonts, sizes, and colors to cycle through
const fonts = ["Arial", "Courier New", "Georgia", "Times New Roman", "Verdana"];
const sizes = [12, 14, 16, 18, 20];
const colors = ["black", "blue", "green", "purple", "red"];
let fontIndex = 0;
let sizeIndex = 0;
let colorIndex = 0;
let lastParagraph; // Track the last inserted "Hello World" paragraph

// Function to insert "Hello World" and store the paragraph reference
async function insertHelloWorld() {
  return Word.run(async (context) => {
    if (lastParagraph) {
      context.trackedObjects.remove(lastParagraph); // Untrack the previous paragraph if it exists
    }

    lastParagraph = context.document.body.insertParagraph("Hello World", Word.InsertLocation.end);
    lastParagraph.font.color = "black";
    context.trackedObjects.add(lastParagraph); // Track the new paragraph

    await context.sync();
  });
}

// Utility function to get the target range: selected text or last "Hello World"
async function getTargetRange(context) {
  const selection = context.document.getSelection();
  selection.load("text");

  await context.sync();

  // Use selection if text is highlighted; otherwise, use last inserted "Hello World"
  return selection.text ? selection : lastParagraph;
}

// Function to cycle through fonts
async function cycleFont() {
  return Word.run(async (context) => {
    const targetRange = await getTargetRange(context);
    targetRange.font.name = fonts[fontIndex];
    fontIndex = (fontIndex + 1) % fonts.length;
    await context.sync();
  });
}

// Function to cycle through font sizes
async function cycleSize() {
  return Word.run(async (context) => {
    const targetRange = await getTargetRange(context);
    targetRange.font.size = sizes[sizeIndex];
    sizeIndex = (sizeIndex + 1) % sizes.length;
    await context.sync();
  });
}

// Function to cycle through colors
async function cycleColor() {
  return Word.run(async (context) => {
    const targetRange = await getTargetRange(context);
    targetRange.font.color = colors[colorIndex];
    colorIndex = (colorIndex + 1) % colors.length;
    await context.sync();
  });
}

// Function to insert an image
async function addImage() {
  return Word.run(async (context) => {
    const imageUrl = "";
    const image = context.document.body.insertInlinePictureFromBase64(imageUrl, Word.InsertLocation.end);
    image.width = 100;
    image.height = 100;

    await context.sync();
  });
}


